import React from "react";
import Nav from "./components/Nav";
import Hero from "./components/Hero";
import cardData from "./cardData.js";


export default function App(){
    const Cards = cardData.map((card) => {
        return (
            <Cards 
                    img={card.img}
                    star={card.star}
                    rating={card.rating}
                    people={card.people}
                    country={card.country}
                    topic={card.topic}
                    amount={card.amount} 
            />
        )
    })

    return(
        <div>
            <Nav />
            <Hero />
            {Cards}
        </div>
    )
}
